import CategoryModel from './CategoryModel'

type Platform =
  | ('darwin' | 'win32' | 'linux')
  | Array<'darwin' | 'win32' | 'linux'>

export default class SearchItemModel {
  public static DEFAULT_SUBTITLE = '默认应用打开'

  public static DEFAULT_SEARCH_ITEMS: Array<SearchItemModel> = []

  static {
    let id = 0
    SearchItemModel.DEFAULT_SEARCH_ITEMS = [
      SearchItemModel.create({
        id: id++,
        title: '百度',
        subtitle: '使用百度搜索',
        url: 'https://www.baidu.com/s?wd={query}',
        keyword: 'bd',
        icon: 'data:image/png;base64,'
      }),
      SearchItemModel.create({
        id: id++,
        title: 'Bing',
        subtitle: '使用必应搜索',
        url: 'https://www.bing.com/search?q={query}',
        keyword: 'b',
        icon: 'data:image/png;base64,'
      }),
      SearchItemModel.create({
        id: id++,
        title: 'Google',
        subtitle: '使用谷歌搜索',
        url: 'https://www.google.com/search?q={query}',
        keyword: 'g',
        icon: 'data:image/png;base64,'
      }),
      SearchItemModel.create({
        id: id++,
        title: 'Wikipedia',
        subtitle: '使用维基百科搜索',
        url: 'https://zh.wikipedia.org/w/index.php?search={query}&title=Special:搜索',
        keyword: 'wiki',
        icon: 'data:image/png;base64,'
      }),
      SearchItemModel.create({
        id: id++,
        title: 'GitHub',
        subtitle: '使用 GitHub 搜索仓库',
        url: 'https://github.com/search?q={query}',
        keyword: 'gh',
        icon: 'data:image/png;base64,'
      }),
      SearchItemModel.create({
        id: id++,
        title: '知乎',
        subtitle: '使用知乎搜索',
        url: 'https://www.zhihu.com/search?type=content&q={query}',
        keyword: 'zh',
        icon: 'data:image/png;base64,'
      }),
      SearchItemModel.create({
        id: id++,
        title: '哔哩哔哩',
        subtitle: '使用哔哩哔哩搜索',
        url: 'https://search.bilibili.com/all?keyword={query}',
        keyword: 'bl',
        icon: 'data:image/png;base64,'
      }),
      SearchItemModel.create({
        id: id++,
        title: '微信公众号',
        subtitle: '搜索微信公众号的文章',
        url: 'https://weixin.sogou.com/weixin?type=2&query={query}',
        icon: 'data:image/png;base64,'
      })
    ]
  }

  id: number
  icon?: string
  title: string = ''
  subtitle: string = ''
  url: string = ''
  keyword?: string
  enabled?: boolean
  app?: string
  platform?: Platform
  categoryId: string

  constructor(id?: number) {
    // 使用自定义 ID 或时间戳作为 ID
    this.id = id ?? Date.now()
    // 设置默认分类
    this.categoryId = CategoryModel.DEFAULT.id
  }

  public static create(props: {
    id: number
    title: string
    subtitle: string
    url: string
    keyword?: string
    icon?: string
  }) {
    const item = new SearchItemModel(props.id)
    item.title = props.title
    item.subtitle = props.subtitle
    item.url = props.url
    item.keyword = props.keyword
    item.icon = props.icon
    return item
  }

  public static checkSearchItem(item: SearchItemModel) {
    // 检查子标题是否存在，如果不存在赋默认值
    item.subtitle = item.subtitle || SearchItemModel.DEFAULT_SUBTITLE
    // 只有输入应用的路径才限定平台
    if (item.app) {
      const getPlatform = () => {
        if (utools.isWindows()) return 'win32'
        if (utools.isMacOS()) return 'darwin'
        return 'linux'
      }
      item.platform = getPlatform()
    } else {
      item.platform = ['win32', 'darwin', 'linux']
    }
  }
}
